webpackJsonp([0xd0292fda6820800],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-reto-de-algoritmo-bu.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/3/3c8584a085a0deaea66b3400e6321eeadab552a2.jpg"></p>\n<h3>Explicación del problema:</h3>\n<ul>\n<li>Este programa es muy simple, el truco está en entender que es un boolaneo primitivo. El programa recibir un parámetro verdadero o falso.</li>\n</ul>\n<h2>Pista: 1</h2>\n<ul>\n<li>Deberás comprobar que el tipo de parámetro recibido sea boolaneo.</li>\n</ul>\n<h2>Pista: 2</h2>\n<ul>\n<li>Para comprobar el tipo de un parámetro puedes utilizar <code>typeof</code></li>\n</ul>\n<h2>Pista: 3</h2>\n<ul>\n<li>Debido a que a que debes retornar true o false puedes utilizar una declaración if o simplemente retornar la sentencia que usarías en la declaración if.</li>\n</ul>\n<h2>¡Alerta de Spoiler!</h2>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/2/2d6c412a50797771301e7ceabd554cef4edcd74d.gif" alt="warning sign"></p>\n<p><strong>¡Solución abajo!</strong></p>\n<h2>Solución del código:</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>function booWho(bool) {\n  return typeof bool === \'boolean\';\n}\n\n// realizamos el test\nbooWho(null);</code></pre>\n      </div>\n<p><img src="/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/CLnK/0\' target=\'_blank\' rel=\'nofollow\'>¡En REPL!</a></p>\n<h1>Explicación del código:</h1>\n<p>Utilizamos el operador <code>typeof</code> para comprobar si una variable es boolanea. Si lo es retornará <code>true</code>. En caso contrario, al ser otro tipo retornará <code>falso</code>.</p>\n<blockquote>\n<p><strong>NOTA:</strong> Por favor añade tu nombre de usuario solamente si has añadido <strong>contenido relevante</strong> al artículo. (Por favor no remuevas ningún nombre existente.)</p>\n</blockquote>',fields:{slug:"/miscellaneous/reto-de-algoritmo-bu/"},frontmatter:{title:"Reto De Algoritmo Bu"}}},pathContext:{slug:"/miscellaneous/reto-de-algoritmo-bu/"}}}});
